import React, { Component } from 'react';

export default class Image extends Component {



    render() {
        let src = this.props.src;
        let details = this.props.details;
        return (
            <>
                <div id="content">

                        <img src={src} alt={details} style={image}/>
                        <h1 style={h}>{details}</h1>

                </div>
            </>
        )
    }
}
const image ={
    width:"250px",
    height:"250px"
}
const h = {
    fontSize:"16px",
    textAlign:"center",
    marginLeft:"50px"
}
